interface ButtonProps {
    label: string;
    variant?: "primary" | "secondary";
  }

  const Button: React.FC<ButtonProps> = ({ label, variant = "primary" }) => {
    const baseStyles = "px-4 py-2 rounded-lg text-white transition-colors duration-300";
    const variantStyles =
      variant === "primary" ? "bg-blue-500 hover:bg-blue-600" : "bg-gray-500 hover:bg-gray-600";

    return <button className={`${baseStyles} ${variantStyles}`}>{label}</button>;
  };

  export default Button;
